 //Function to convert hex format to a rgb color
 function rgb2hex(rgb) {
     rgb = rgb.match(/^rgb\((\d+),\s*(\d+),\s*(\d+)\)$/);
     return "#" + hex(rgb[1]) + hex(rgb[2]) + hex(rgb[3]);
 }

 function hex(x) {
     return isNaN(x) ? "00" : hexDigits[(x - x % 16) / 16] + hexDigits[x % 16];
 }

 // checks whether or not two courses overlap
 function doesOverLap(startHour1, startHour2, startMin1, startMin2, duration1, duration2, days1, days2) {
    var overlapCount = 0;
    if (days1 === "None" || days2 === "None") {return false;}
    for(var i = 0; i < days2.length; i++){
        if(days1.indexOf(days2[i]) !== -1){overlapCount++;}
    }
    if(overlapCount === 0){
        return false;
    }
    if (startHour1 === startHour2 && startMin1 === startMin2) {
        return true;
    }
    if (startHour1 < 8) {
        startHour1 += 12;
    }
    if (startHour2 < 8) {
        startHour2 += 12;
    }
    startHour1 += startMin1 / 60
    startHour2 += startMin2 / 60
    if (startHour1 < startHour2) {
        if (startHour1 + duration1 / 60 > startHour2) {
            return true;
        }
    } else {
        if (startHour2 + duration2 / 60 > startHour1) {
            return true;
        }
    }
    return false;
}

 // Algorithm idea is get all data from all courses whose background is not white
 // redistribute in order (then somehow rearrange colors)
 // Collapse all courses left so there are no holes
 // I can reverse look up course by the abbreviation which will be in the text
 function collapse() {
     if (count == 0) {
         return false;
     }
     var i = 0;
     var currColors = [];
     var currTitles = [];
     // Get the color and the course id of all the current courses
     $('.course').each(function () {
         if (rgb2hex($(this).css("background-color")) !== "#fffbf5") {
             currColors.push(rgb2hex($(this).css("background-color")));
             currTitles.push($(this).children(".course-id").text());
             $(this).children(".course-delete").remove();
             $(this).children(".course-info").remove();
             $(this).children(".course-id").text("");
             $(this).css('background', "#fffbf5");
         }
         if (++i === count + 1) {
             return false;
         }
     });
     // Redistribute the classes
     // This is where reverse lookup will eventually happen	
     i = 0;
     $('div.course').each(function () {
         if (i >= currTitles.length) {
             return false;
         }
         $(this).children(".course-id").text(currTitles[i]);
         $(this).css('background', currColors[i++]);
         $(this).append("<button id='temp' class='course-delete'><strong>X</strong></button>");
         $(this).append("<button class='course-info'><strong>?<strong></button>");
     });
     var i = currColors.length - 1;
 };

// Do something to ensure the wrong course isn't removed when adding multiple sections of one course
 function removeFromPlanner(courseLoc) {
     // Get the course we want to remove
     var course = schedule[courseLoc];
     // create the days we want to place in the array
     var daysArray = [];
     for (var i = 0; i < course.days.length; i++) {
         daysArray.push(course.days[i] + parseInt(course.startHour));
     }
     // Remove all of the courses from the planner
     for (var i = 0; i < daysArray.length; i++) {
         currCourse = "#" + daysArray[i];
         $(currCourse).children(".overflow").text(""); // Give class label
         $(currCourse).children(".overflow").css({
             'background': "#fff",
             'height': "0px"
         }); // Set class background color
     }
     if (course.lab !== "None") {
         daysArray = [];
         for (var i = 0; i < course.lab.length; i++) {
             daysArray.push(course.lab[i] + parseInt(course.labHour));
         }
         // Remove all of the courses from the planner
         for (var i = 0; i < daysArray.length; i++) {
             currCourse = "#" + daysArray[i];
             $(currCourse).children(".overflow").text(""); // Give class label
             $(currCourse).children(".overflow").css({
                 'background': "#fff",
                 'height': "0px"
             }); // Set class background color
         }
     }
 };

 // Remove course function that will be used in the case of overlaps
 function removeCourse(scheduleIndex){
    var course = "#course"+parseInt(scheduleIndex+1);
    colorArray.push(rgb2hex($(course).css("background-color")));
    $(course).css('background', "#fffbf5");
    removeFromPlanner(scheduleIndex);
    $(course).children(".course-id").text("");
    $(course).children(".course-delete").remove();
    $(course).children(".course-info").remove();
    schedule.splice(scheduleIndex, 1);
    count--;
    collapse();
 };

 // Add course function that is used in overlaps and regular adds
 function addCourse(course){
    var color = colorArray.reverse().pop();
    // Add the course id to the course
    $(".course").eq(count).children(".course-id").text(course.value);
    // Change the background color
    $(".course").eq(count).css('background', color);
    // Add remove course button
    $(".course").eq(count).append("<button class='course-delete'><strong>X<strong></button>");
    $(".course").eq(count).append("<button class='course-info'><strong>?<strong></button>");
    // Add the class to the schedule
    addToPlanner(course, color);
    // Push the item onto the list of current classes
    schedule.push(course);
    colorArray.reverse(); // get color array back in corrrect order
    count++;
 }

 // Function for remvoing classes from the class list
 $(document).on("click", ".course-delete", function () {
     var course = $(this).parent();
     var courseLoc = parseInt($(course).attr("id").charAt($(course).attr("id").length - 1));
     colorArray.push(rgb2hex($(this).css("background-color")));
     $(course).css('background', "#fffbf5");
     removeFromPlanner(courseLoc-1);
     $(course).children(".course-id").text("");
     $(course).children(".course-info").remove();
     $(this).remove();
     schedule.splice(courseLoc - 1, 1);
     count--;
     collapse();
 });

 // Functioned to add classes to the calendar
 function addToPlanner(course, color) {
     var daysArray = [];
     // Loop to get IDs of each div the class will occupy
     for (var i = 0; i < course.days.length; i++) {
         daysArray.push(course.days[i] + parseInt(course.startHour));
     }
     for (var i = 0; i < daysArray.length; i++) {
         var currCourse = "#" + daysArray[i];
         $(currCourse).children(".overflow").text(course.value); // Give class label
         $(currCourse).children(".overflow").css({
             'background': color,
             'margin-top': parseInt(minuteDict[course.startMinute] - 9) + "px",
             'line-height': parseInt(timeDict[course.duration]) + "px"
         }); // Set class background color
         $(currCourse).children(".overflow").height(timeDict[course.duration]); // Set height of class
         //$(currCourse).children(".overflow").css(minuteDict[course.startMinute]); // Set start height 
     }
     // Remove the lab if there if one
     if (course.lab !== "None") {
         daysArray = []
         for (var i = 0; i < course.lab.length; i++) {
             daysArray.push(course.lab[i] + parseInt(course.labHour));
         }
         for (var i = 0; i < daysArray.length; i++) {
             var currCourse = "#" + daysArray[i];
             $(currCourse).children(".overflow").text(course.value); // Give class label
             $(currCourse).children(".overflow").css({
                 'background': color,
                 'margin-top': parseInt(minuteDict[course.labMin] - 9) + "px",
                 'line-height': parseInt(timeDict[course.labDur]) + "px"
             }); // Set class background color
             $(currCourse).children(".overflow").height(timeDict[course.labDur]); // Set height of class
             //$(currCourse).children(".overflow").css(minuteDict[course.startMinute]); // Set start height 
         }
     }
 };

 // Allow searcch by department, course title, and professor name
 function custom_source(request, response) {
     var matcher = new RegExp($.ui.autocomplete.escapeRegex(request.term), "i");
     response($.grep(data, function (value) {
         return matcher.test(value.value) || matcher.test(value.label) || matcher.test(value.prof);
     }));
 }

