function clockConversion(startHour, min, duration){
    var start = String(startHour);
    if(startHour < 10){
        start = "0"+start;
    }
    start = start +":";
    var startMin = String(min);
    if (startMin.length < 2){
        startMin = "0" + startMin;
    }
    start = start + startMin + " - ";
    var end = Math.floor(duration/60) + startHour;
    if (end > 12){
        end = end - 12;
    }
    end = String(end);
    if (end.length < 2){
        end = "0" + end;
    }
    var endMin = duration%60+min;
    if(endMin>59){
        endMin = endMin-60;
    }
    endMin = String(endMin);
    if (endMin.length<2){
        endMin = "0" + endMin
    }
    return start + end + ":" + endMin;

}
